import {Link} from "react-router-dom";
import "./Header.css";
function Header(){
    return(
        <div class="header">
            <div class="leftside">
                <h1>Learncode</h1>
                <input type="text" placeholder="Search..." />
                <button class="search">Search</button>
                <ul>
                    <Link to=""><li>Login</li></Link>
                    <Link to=""><li>Logout</li></Link>
                </ul>
            </div>
        </div>

    );
}
export default Header;
